import React, { useState } from 'react';
import './Drafts.css';

const Drafts = () => {
  const [policyNo, setPolicyNo] = useState('DFT-PL-SLR-CP-DOC-PLY01');
  const [type, setType] = useState('Plant');
  const [department, setDepartment] = useState('Contracts & Procurement (CP)');
  const [classification, setClassification] = useState('');
  const [sbu, setSbu] = useState('Solar');
  const [category, setCategory] = useState('');
  const [title, setTitle] = useState('test');
  const [description, setDescription] = useState('test');
  const [fileInfo, setFileInfo] = useState('greenko-magazine.pdf (26.78 MB)');
  const [reviews, setReviews] = useState('Pending');

  const handleSubmit = (event) => {
    event.preventDefault();
    alert('Form submitted!');
  };

  return (
    <div className="container">
      <div className="header">
        <h1>Document Management</h1>
      </div>
      <div className="form-container">
        <form onSubmit={handleSubmit}>
          <div className="form-group">
            <label htmlFor="policy-no">Policy No.</label>
            <input
              type="text"
              id="policy-no"
              value={policyNo}
              onChange={(e) => setPolicyNo(e.target.value)}
            />
          </div>
          <div className="form-group">
            <label htmlFor="type">Type</label>
            <input
              type="text"
              id="type"
              value={type}
              onChange={(e) => setType(e.target.value)}
            />
          </div>
          <div className="form-group">
            <label htmlFor="department">Department/Function Name</label>
            <input
              type="text"
              id="department"
              value={department}
              onChange={(e) => setDepartment(e.target.value)}
            />
          </div>
          <div className="form-group">
            <label htmlFor="classification">Classification</label>
            <select
              id="classification"
              value={classification}
              onChange={(e) => setClassification(e.target.value)}
            >
              <option value="">Select</option>
              <option value="restricted">Restricted</option>
              <option value="confidential">Confidential</option>
              <option value="protected">Protected</option>
              <option value="public">Public</option>
            </select>
          </div>
          <div className="form-group">
            <label htmlFor="sbu">SBU</label>
            <input
              type="text"
              id="sbu"
              value={sbu}
              onChange={(e) => setSbu(e.target.value)}
            />
          </div>
          <div className="form-group">
            <label htmlFor="category">Category</label>
            <input
              type="text"
              id="category"
              value={category}
              onChange={(e) => setCategory(e.target.value)}
            />
          </div>
          <div className="form-group">
            <label htmlFor="title">Title</label>
            <input
              type="text"
              id="title"
              value={title}
              onChange={(e) => setTitle(e.target.value)}
            />
          </div>
          <div className="form-group">
            <label htmlFor="description">Description</label>
            <textarea
              id="description"
              rows="4"
              value={description}
              onChange={(e) => setDescription(e.target.value)}
            ></textarea>
          </div>
          <div className="form-group">
            <label htmlFor="policy-file">Policy File</label>
            <input
              type="file"
              id="policy-file"
            />
            <p className="file-info">{fileInfo}</p>
          </div>
          <div className="form-group">
            <label htmlFor="reviews">Reviews</label>
            <input
              type="text"
              id="reviews"
              value={reviews}
              disabled
            />
          </div>
          <button type="submit">Submit</button>
        </form>
      </div>
    </div>
  );
};

export default Drafts;
